import React, { Component } from 'react'

export default class AutoCompleteText extends Component {
  constructor(props){
      super(props);
    this.items = ["Fear",
    "Anger",
    "Sad",
    "Disconnected",
    "Disoriented",
    "Unreal",
    "Jittery",
    "Anxious",
    "Depressed"

    ];
  }



    render() {
    return (
      <div>
        <input type="text"/>
        <ul>
            {this.items.map(item => <li>item</li>)}
        </ul>
      </div>
    )
  }
}
